const Dashboard = () => {
  return (
    <>
      <h2>Hello, Student</h2>

      <p>Borrowed Books: 0</p>
      <p>Available Books: 185</p>

      <h3>Quick Links</h3>
      <button>View Book</button>
      <button>My Books</button>
    </>
  );
};

export default Dashboard;
